import React from "react";

const App = () => {
  return (
    <div>
      <h2>사진첩</h2>
      <form>
        <label htmlFor="image">사진</label>
        <input id="image" type="file" />
        <button type="submit">제출</button>
      </form>
    </div>
  );
}

export default App;
